window.playVideo = function (id) {
	var iframe = document.getElementById(id).getElementsByTagName('iframe')[0];
	var parent = findAncestor(iframe, 'js-modal');
	if (iframe.getAttribute('data-video-type') == 'youtube') {
		if (parent.classList.contains('not-active')) {
			parent.classList.remove('not-active');
			return;
		}
		iframe.contentWindow.postMessage('{"event":"command","func":"playVideo","args":""}', '*');
	} else {
		if (parent.classList.contains('not-active')) {
			parent.classList.remove('not-active');
			return;
		}
		iframe.setAttribute('src', iframe.getAttribute('data-video-url'));
	}
	parent.classList.add('is-active');
};

window.pauseVideo = function (id) {
	var iframe = document.getElementById(id).getElementsByTagName('iframe')[0];

	if (iframe) {

		var parent = findAncestor(iframe, 'js-modal');
	}

	if (iframe.getAttribute('data-video-type') == 'youtube') {
		iframe.contentWindow.postMessage('{"event":"command","func":"pauseVideo","args":""}', '*');
		parent.classList.remove('is-active');
		parent.classList.add('not-active');
	} else {
		iframe.setAttribute('src', '');
		parent.classList.remove('is-active');
		parent.classList.add('not-active');
	}
};

window.findAncestor = function (el, cls) {
	while ((el = el.parentElement) && !el.classList.contains(cls)) {}
	return el;
};

