function animateMultipleEl(elem) {
  var childsArr = Array.prototype.slice.call(elem.querySelectorAll('.animate-child'));
  var count = 0;
  childsArr[count].classList.add('active');
  count++;
  var spacer = setInterval(function () {
    if (count < childsArr.length) {
      if (!childsArr[count].classList.contains('active')) {
        childsArr[count].classList.add('active');
        count++;
      } else {
        count++;
      }
    } else {
      clearInterval(spacer);
    }
  }, 400);
}

// custom is in View function
function isInViewport(element) {
  var rect = element.getBoundingClientRect();
  var viewPort = window.innerHeight;
  var viewPortWidth = window.innerWidth;
  var isVisibleTop = rect.top / viewPort * 100;
  var isVisibleBottom = rect.bottom / viewPort * 100;
  var isInView = false;

  if (viewPortWidth > 859) {
    if (rect.top >= 0 && rect.bottom <= viewPort) {
      isInView = true;
      return isInView;
    } else if (isVisibleTop <= 70 && rect.bottom > viewPort) {
      isInView = true;
      return isInView;
    } else if (isVisibleBottom >= 30 && rect.top <= 0) {
      isInView = true;
      return isInView;
    } else {
      return isInView;
    }
  } else if (viewPortWidth <= 859) {
    if (rect.top >= 0 && rect.bottom <= viewPort) {
      isInView = true;
      return isInView;
    } else if (isVisibleTop <= 90 && rect.bottom > viewPort) {
      isInView = true;
      return isInView;
    } else if (isVisibleBottom >= 10 && rect.top <= 0) {
      isInView = true;
      return isInView;
    } else {
      return isInView;
    }
  }
}
