(function () {

	window.addEventListener('DOMContentLoaded', function () {
		function Accordion(view) {
			if (view) {

				var linkArr = esriClientUtils.selectAll('.faq-accordion-item-section', view);
				var sectArr = esriClientUtils.selectAll('.accordion-title', view);
				var openClose = esriClientUtils.select('.show-hide-all', view);
				var textinfo = esriClientUtils.select('.openCloseText', view);
				var allArrow = esriClientUtils.select('.show-hide-caret', view);
				var openCloseAttr = openClose.getAttribute('aria-hidden');

				var hideAll = function hideAll(link, isFalse) {
					openClose.setAttribute('aria-hidden', 'false');
					event.preventDefault();
					textinfo.innerHTML = "Hide All";
					allArrow.classList.remove('icon-ui-down');
					allArrow.classList.add('icon-ui-up');
					if (isFalse) {
						link.classList.add('is-active');
					}
				};

				var showAll = function showAll(link, isTrue) {
					openClose.setAttribute('aria-hidden', 'true');
					event.preventDefault();
					textinfo.innerHTML = "Show All";
					allArrow.classList.remove('icon-ui-up');
					allArrow.classList.add('icon-ui-down');
					if (isTrue) {
						link.classList.remove('is-active');
					}
				};

				sectArr.forEach(function (el) {
					el.addEventListener('click', function (evt) {
						var sectCount = esriClientUtils.select('.faq-accordion--content', view);
						var sectExpanded = sectCount.querySelectorAll('.faq-accordion-item-section.is-active').length;
						var sectTotal = sectCount.querySelectorAll('.faq-accordion-item-section').length;
						var half = 2;

						sectExpanded > sectTotal / half ? hideAll() : showAll();

						openCloseAttr = openClose.getAttribute('aria-hidden');
					});
				});

				openClose.addEventListener('click', function (event) {
					if (openCloseAttr === "true") {
						linkArr.forEach(function (link) {
							hideAll(link, true);
						});
					} else if (openCloseAttr === "false") {
						linkArr.forEach(function (link) {
							showAll(link, true);
						});
					}
					openCloseAttr = openClose.getAttribute('aria-hidden');
				});
			}
		}
		var accordions = esriClientUtils.selectAll(".faq-accordion--outer");
		accordions.forEach(function (accordion) {
			new Accordion(accordion);
		});
	});
})();

