(function () {
    window.addEventListener('DOMContentLoaded', function () {
        var cardHtml = '';
        var rssTools = {
            getAjax: function getAjax(url) {
                return new Promise(function (resolve, reject) {
                    var xhr = new XMLHttpRequest();
                    xhr.open('GET', url);
                    xhr.setRequestHeader('Content-Type', 'text/xml');

                    xhr.onreadystatechange = function () {
                        if (xhr.readyState === 4) {
                            if (xhr.status === 200) {
                                resolve(xhr.responseText);
                            } else {
                                reject('failed!');
                            }
                        }
                    };

                    xhr.send();
                });
            },
            beautifyDate: function beautifyDate(dateString) {
                var months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];
                var realDate = new Date(dateString);
                var month = months[realDate.getMonth()];
                return month + ' ' + realDate.getUTCDate() + ', ' + realDate.getFullYear();
            },
            replaceAllSubStrings: function replaceAllSubStrings(html, stringsToReplace) {
                if (html) {
                    Object.keys(stringsToReplace).forEach(function (key) {
                        var regex = new RegExp(key, "g");
                        html = html.replace(regex, stringsToReplace[key]);
                    });
                    return html;
                } else {
                    return '';
                }
            },
            maxCharsWithEllipsis: function maxCharsWithEllipsis(text, maxChars) {

                if (text && text.length >= maxChars) {

                    text = text.substring(0, maxChars);
                    var parts = text.split(' ');
                    parts.pop();

                    text = '';

                    for (var i = 0; i < parts.length; i++) {
                        if (i < parts.length - 1) {
                            text += parts[i] + ' ';
                        } else {
                            text += parts[i];
                        }
                    }
                    return text + '...';
                }

                return text;
            },
            cardTemplate: '<div class="card block trailer-1">\
                <div class="card-content csc-text-container panel panel-no-border">\
                    <small>@@date@@</small>\
                    <p class="leader-half rss-feed-title font-size-2">\
                        <a href="@@link@@">@@title@@</a>\
                    </p>\
                    <p class="rss-feed-more-text font-size--1 avenir-light">@@description@@</p>\
                </div>\
            </div>'

        };

        [].slice.call(document.querySelectorAll('.rss-renderer-wrapper')).forEach(function (rssRenderer) {
            // 3014 proxy needs work...  var rssUrl = 'https://webnode.esri.com/3014/proxy?url=' + rssRenderer.getAttribute('data-url');
            var rssUrl = 'https://webappsproxy.esri.com/passthrough?' + rssRenderer.getAttribute('data-url');

            var count = parseInt(rssRenderer.getAttribute('data-count'));
            var maxChars = parseInt(rssRenderer.getAttribute('data-max-chars')) || 140;

            jQuery.get(rssUrl, function (xml) {
                var parser = new DOMParser();

                if (xml && !!xml.children.length) {
                    var xmlDoc = parser.parseFromString(xml.children[0].outerHTML, "text/xml");

                    var items = [].slice.call(xmlDoc.querySelectorAll('item')).slice(0, count);

                    items.forEach(function (item) {
                        var title = item.querySelector('title').innerHTML.replace("<![CDATA[", "").replace("]]>", "");
                        var lnk = item.querySelector('link').innerHTML;
                        var pubDate = item.querySelector('pubDate').innerHTML;
                        var desc = item.querySelector('description').innerHTML.replace("<![CDATA[", "").replace("]]>", "");
                        if (item.querySelector('shortDescription')) {
                            desc = item.querySelector('shortDescription').innerHTML.replace("<![CDATA[", "").replace("]]>", "");
                        }

                        if (desc.indexOf('&lt;div') > -1) {
                            var descDecoded = rssTools.replaceAllSubStrings(desc, {
                                '&lt;': '<',
                                '&gt;': '>',
                                '&amp;': '',
                                '#160;': ''
                            });
                            var descParser = new DOMParser();
                            var descHtml = descParser.parseFromString(descDecoded, "text/xml");
                            var paragraphsInnerHTML = "";

                            [].slice.call(descHtml.querySelectorAll('p')).forEach(function (paragraph) {
                                paragraphsInnerHTML += " " + paragraph.innerHTML;
                            });
                            desc = rssTools.maxCharsWithEllipsis(paragraphsInnerHTML, maxChars);
                        } else {
                            desc = rssTools.maxCharsWithEllipsis(desc, maxChars);
                        }

                        var svgArrow = '<svg class="right-arrow-blue rss-feed-right-arrow-blue" version="1.1" id="Layer_1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 16 16" enable-background="new 0 0 16 16" xml:space="preserve"><g><path d="M8,14.296875l5.3125-5.3125H0V8h13.28125L8,2.703125V1.28125L15.21875,8.5L8,15.71875V14.296875z"></path></g></svg>';
                        desc += ' <a href="' + lnk + '" class="rss-feed-more-text-link avenir-light">Continue reading' + svgArrow + '</a>';
                        cardHtml += rssTools.replaceAllSubStrings(rssTools.cardTemplate, {
                            '@@title@@': title,
                            '@@description@@': desc,
                            '@@link@@': lnk,
                            '@@date@@': rssTools.beautifyDate(pubDate)
                        });
                    });
                }

                rssRenderer.getElementsByClassName('item-wrapper')[0].innerHTML = cardHtml;
                rssRenderer.getElementsByClassName('loader')[0].classList.remove('is-active');
                cardHtml = '';
            });
        });
    });
})();

