(function () {
	var anchorNavFunc = function anchorNavFunc(view) {
		var block = view;
		var topNavMark = block.querySelector('.topEdge');
		var bottomNavMark = block.querySelector('.bottomEdge');
		var contentNavSec = block.querySelector('.nav-section');
		var docNavElem = window.document.documentElement;
		var navheight = document.querySelector('.anchor-container').offsetHeight;

		function checkAndRemove(navelm, _class) {
			if (navelm && navelm.classList.contains(_class)) {
				navelm.classList.remove(_class);
			}
		}

		function checkAndAdd(navelm, _class) {
			if (navelm && !navelm.classList.contains(_class)) {
				navelm.classList.add(_class);
			}
		}

		function setContentNavPosition() {
			if (window.innerWidth > 700) {
				var docNavElemH = docNavElem.clientHeight;
				var blockNavTop = topNavMark.getBoundingClientRect().top,
				    blockNavBottom = bottomNavMark.getBoundingClientRect().bottom,
				    top = Math.ceil(blockNavTop / docNavElemH * 150),
				    bottom = Math.ceil(blockNavBottom / docNavElemH * 150);

				if (top > 30) {
					checkAndRemove(contentNavSec, 'centered');
				} else if (bottom < 125) {
					checkAndRemove(contentNavSec, 'centered');
					checkAndAdd(contentNavSec, 'bottom-aligned');
				} else {
					checkAndAdd(contentNavSec, 'centered');
					checkAndRemove(contentNavSec, 'bottom-aligned');
				}
			}
		}

		if (window.innerWidth > 700) {
			//window.addEventListener('scroll', setContentNavPosition, false);
			window.addEventListener('scroll', utils.throttle(function () {
				setContentNavPosition();
			}, 10));
		}
	};

	//anchorNavFunc.init();
	document.addEventListener("DOMContentLoaded", function () {
		var views = [].slice.call(document.querySelectorAll('.anchor-nav-wrapper'));
		views.forEach(function (view) {
			new anchorNavFunc(view);
		});
	});
})();

